import React from "react";

function Services({ services }) {
  if (!services) return null;
  return (
    <section style={{ padding: "20px", background: "#f9f9f9" }}>
      <h2>Services</h2>
      <div>
        {services.map((s, i) => (
          <div key={i} style={{ marginBottom: "10px" }}>
            <h4>{s.title}</h4>
            <p>{s.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Services;
